import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import Myweek from './Myweek';
import Detail from './Detail';

function App() {

    const [day, setDay] = React.useState(['MON', 'TUE', 'WED', 'THU', 'FRI', 'SAT', 'SUN']);

    const [dayday, setDayday] = React.useState(['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday']);

    const [count, setCount] = React.useState(5);

    const circle_count = Array.from({ length: count }, (el, i) => i);
    console.log(circle_count);

    return (
        <div className="App">
            <div style={{
                width: "500px",
                height: "700px",
                border: "1px solid lightgrey",
                margin: "80px auto",
                borderRadius: "20px",
            }} >
                <div style={{
                    width: "400px",
                    margin: "80px auto",
                }}>
                    <div>
                    <h3 style={{
                        margin: "30px auto",
                        fontSize: "24px",
                    }}>How you feel today?</h3>
                    </div>

                    <Routes>
                        <Route path="/" element={<Myweek day={day} />}>
                        </Route>
                        <Route path="/detail" element={<Detail dayday={dayday} />}>
                        </Route>
                        <Route element={<Circle circle_count={circle_count} />}>
                        </Route>
                    </Routes>
                </div>
            </div>
        </div>
    );
}

export default App;
